import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import '../styles/Profile.css';

const Profile = () => {
    const navigate = useNavigate();
    const [user, setUser] = useState(null);
    const [bookings, setBookings] = useState([]);
    const [error, setError] = useState('');

    useEffect(() => {
        const token = localStorage.getItem('token');
        if (!token) {
            navigate('/');
            return;
        }

        // Fetch user profile
        axios
            .get('http://localhost:5001/api/auth/profile', {
                headers: { Authorization: `Bearer ${token}` },
            })
            .then((response) => {
                setUser(response.data);
                setError('');
            })
            .catch((error) => {
                console.error('Error fetching profile:', error);
                setError('Failed to load profile. Please log in again.');
                localStorage.removeItem('token');
                localStorage.removeItem('user');
                navigate('/');
            });

        // Fetch booking history
        axios
            .get('http://localhost:5001/api/bookings/user', {
                headers: { Authorization: `Bearer ${token}` },
            })
            .then((response) => {
                setBookings(response.data);
            })
            .catch((error) => {
                console.error('Error fetching bookings:', error);
                setError('Failed to load booking history.');
            });
    }, [navigate]);

    if (!user && !error) return <p>Loading profile...</p>;
    if (error) return <p style={{ color: 'red' }}>{error}</p>;

    return (
        <div className="profile-container">
            <h1>Welcome, {user.username}</h1>
            <div className="profile-info">
                <img
                    src="https://via.placeholder.com/150"
                    alt="Profile"
                    className="profile-picture"
                />
                <p><strong>Email:</strong> {user.email}</p>
                <p><strong>Role:</strong> {user.role}</p>
                <h2>About Me</h2>
                <p>
                    Hello! Iâ€™m {user.username}, a valued client of Moon's Salon. I enjoy
                    our premium beauty services!
                </p>
            </div>

            <div className="booking-history">
                <h2>Booking History</h2>
                {bookings.length === 0 ? (
                    <p>No bookings yet.</p>
                ) : (
                    <table>
                        <thead>
                            <tr>
                                <th>Service</th>
                                <th>Stylist</th>
                                <th>Date/Time</th>
                                <th>Location</th>
                                <th>Status</th>
                            </tr>
                        </thead>
                        <tbody>
                            {bookings.map((booking) => (
                                <tr key={booking._id}>
                                    <td>{booking.service}</td>
                                    <td>{booking.stylist}</td>
                                    <td>{new Date(booking.dateTime).toLocaleString()}</td>
                                    <td>{booking.locationType}</td>
                                    <td>{booking.status}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                )}
            </div>

            <button
                onClick={() => {
                    localStorage.removeItem('token');
                    localStorage.removeItem('user');
                    navigate('/');
                    window.location.reload();
                }}
            >
                Logout
            </button>
        </div>
    );
};

export default Profile;
